import {HttpClient} from "@angular/common/http";
import {Observable} from "rxjs";
import {RegisterData} from "../models/request/RegisterData";
import {ResponseData} from "../models/ResponseData";
import {Injectable} from "@angular/core";

@Injectable(
  provideIn:
)
export class SignUpService {

  constructor(private http: HttpClient) {
  }

  public signup(formValues: any): Observable<ResponseData<RegisterData>> {
    let email:string = formValues['email'];
    let username:string = formValues['username'];
    let password:string = formValues['password1'];

    return this.http.post<ResponseData<RegisterData>>('http://localhost:8080/api/open/register', {
      email, username, password
    });
  }

}
